import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import { motion } from 'framer-motion';

const WhatWeDeliver = () => {
  const [csvData, setCsvData] = useState([]);
  const [csvHeaders, setCsvHeaders] = useState([]);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      Papa.parse(file, {
        header: true, // Assuming the first row contains headers
        dynamicTyping: true, // Attempt to convert column values to appropriate types
        skipEmptyLines: true,
        complete: function(results) {
          setCsvHeaders(Object.keys(results.data[0] || {})); // Get headers from the first data row
          setCsvData(results.data);
        }
      });
    }
  };

  return (
    <div className="min-h-screen animate-slideIn">
      {/* First Section - Dark Blue */}
      <section className="relative min-h-screen bg-[#070c24] flex flex-col items-center justify-center">
        <Navbar />
        <div className="container mx-auto px-4 pt-20">
          <h1 className="text-4xl md:text-6xl text-white font-bold mb-6">
            What We Deliver
          </h1>
          <p className="text-white/80 text-lg md:text-xl max-w-2xl">
            Explore our comprehensive solutions and deliverables that drive success.
          </p>
        </div>

        <div className="absolute left-1/2 bottom-1 -translate-x-1/2 flex flex-col items-center gap-2">
          <div className="w-[1px] h-24 bg-white/20 relative overflow-hidden">
            <motion.div
              className="w-full h-full bg-white"
              animate={{
                y: ['-100%', '100%'],
              }}
              transition={{
                repeat: Infinity,
                duration: 1.5,
                ease: 'linear',
              }}
            />
          </div>
        </div>
      </section>

      {/* Second Section - White */}
      <section className="min-h-screen bg-white py-16">
    
      </section>
    </div>
  );
};

export default WhatWeDeliver;
